import React from 'react'
import './logMainbody.css'
import axios from 'axios';
import LogHeader from './logHeader'


class LogMainbody extends React.Component{
    constructor(props) {
        super(props);
        this.state = { email: '' ,
            password: ''};

    }

    changeHandler = e => {
        this.setState({
            [e.target.name]: e.target.value
        });
    }


    submitHandler= e => {
        e.preventDefault();
        console.log(this.state)
        axios.post('192.168.1.93:8090/login ', this.state).then(response => {
            console.log(response)
        }).catch(error => {
            console.log(error)
        })
    }

    render(){
        return (<div>
            <LogHeader/>

            <form onSubmit={this.submitHandler}>
                <h1 className='head'>ONE-ON-ONE</h1>
            <div className="container">
                <div className="card card-container">


                    <form className="form-signin">
                        <h1 className="log">LOGIN</h1>
                        <input type="text"
                               id="email"
                               className="form-control"
                               placeholder="Employee ID"
                               onChange={this.changeHandler}


                               required autoFocus/>

                        <input type="password"
                               id="password"
                               className="form-control"
                               placeholder="Password"
                               onChange={this.changeHandler}
                               required />

                        <button className="btn btn-lg btn-primary btn-block btn-signin"
                                type="submit">Sign in</button>

                    </form>{/* /form */}

                </div>{/* /card-container */}
            </div>
</form>
            </div>
    );
    }
}
export default LogMainbody
